import React, { useState, useEffect, useRef } from 'react';

const QWS_LOGO = 'data:image/png;base64,';

const BRAND = { olive: '#5C6B4A', brown: '#6B5D4D', black: '#0A0A0A', blackLight: '#1A1A1A', cream: '#F5F3EF', creamMuted: '#A8A29C' };

const BIRDS = [
  { code: 'EABL', name: 'Eastern Bluebird' },
  { code: 'NOCA', name: 'Northern Cardinal' },
  { code: 'CARW', name: 'Carolina Wren' },
  { code: 'MODO', name: 'Mourning Dove' },
  { code: 'BLJA', name: 'Blue Jay' },
  { code: 'RBWO', name: 'Red-bellied Woodpecker' },
  { code: 'TUTI', name: 'Tufted Titmouse' },
  { code: 'EASO', name: 'Eastern Screech-Owl' },
  { code: 'BANO', name: 'Barn Owl' },
  { code: 'GHOW', name: 'Great Horned Owl' },
  { code: 'BAOW', name: 'Barred Owl' },
  { code: 'RTHA', name: 'Red-tailed Hawk' },
  { code: 'WODU', name: 'Wood Duck' },
  { code: 'NOMO', name: 'Northern Mockingbird' },
];

const CENTER = { lat: 34.7304, lng: -86.5861 };

function App() {
  const [loading, setLoading] = useState(true);
  const [user, setUser] = useState(null);
  const [users, setUsers] = useState([]);
  const [showLogin, setShowLogin] = useState(true);
  const [loginForm, setLoginForm] = useState({ email: '', password: '' });
  const [regMode, setRegMode] = useState(false);
  const [regForm, setRegForm] = useState({ name: '', email: '', password: '' });
  const [detections, setDetections] = useState([]);
  const [stations, setStations] = useState([]);
  const [boxes, setBoxes] = useState([]);
  const [location, setLocation] = useState(null);
  const [mapCenter, setMapCenter] = useState(CENTER);
  const [zoom, setZoom] = useState(14);
  const [selected, setSelected] = useState(null);
  const [panel, setPanel] = useState(null);
  const [recording, setRecording] = useState(false);
  const [audioBlob, setAudioBlob] = useState(null);
  const [selSpecies, setSelSpecies] = useState(null);
  const [filter, setFilter] = useState('');
  const [layers, setLayers] = useState({ detections: true, stations: true, boxes: true });
  const [boxForm, setBoxForm] = useState({ name: '', type: 'bluebird' });
  const mediaRef = useRef(null);
  const chunks = useRef([]);

  useEffect(() => {
    try {
      const d = localStorage.getItem('qws-detections');
      const s = localStorage.getItem('qws-stations');
      const b = localStorage.getItem('qws-boxes');
      const u = localStorage.getItem('qws-users');
      const sess = localStorage.getItem('qws-session');
      if (d) setDetections(JSON.parse(d));
      if (s) setStations(JSON.parse(s));
      if (b) setBoxes(JSON.parse(b));
      if (u) setUsers(JSON.parse(u));
      if (sess) { setUser(JSON.parse(sess)); setShowLogin(false); }
    } catch (e) {}
    setLoading(false);
  }, []);

  useEffect(() => {
    if (!loading) {
      localStorage.setItem('qws-detections', JSON.stringify(detections));
      localStorage.setItem('qws-stations', JSON.stringify(stations));
      localStorage.setItem('qws-boxes', JSON.stringify(boxes));
    }
  }, [detections, stations, boxes, loading]);

  useEffect(() => {
    if (!loading && users.length) localStorage.setItem('qws-users', JSON.stringify(users));
  }, [users, loading]);

  useEffect(() => {
    if (showLogin || !navigator.geolocation) return;
    const id = navigator.geolocation.watchPosition(p => {
      const loc = { lat: p.coords.latitude, lng: p.coords.longitude };
      setLocation(loc);
      if (mapCenter.lat === CENTER.lat) setMapCenter(loc);
    }, () => {}, { enableHighAccuracy: true });
    return () => navigator.geolocation.clearWatch(id);
  }, [showLogin, mapCenter]);

  const login = () => {
    const u = users.find(x => x.email === loginForm.email && x.password === loginForm.password);
    if (u) { setUser(u); setShowLogin(false); localStorage.setItem('qws-session', JSON.stringify(u)); }
    else alert('Invalid credentials');
  };

  const register = () => {
    if (!regForm.name || !regForm.email || !regForm.password) return alert('Fill all fields');
    if (users.find(x => x.email === regForm.email)) return alert('Email exists');
    const u = { id: Date.now(), ...regForm, role: users.length ? 'volunteer' : 'admin' };
    const newUsers = [...users, u];
    setUsers(newUsers);
    setUser(u);
    setShowLogin(false);
    localStorage.setItem('qws-session', JSON.stringify(u));
    localStorage.setItem('qws-users', JSON.stringify(newUsers));
  };

  const logout = () => { setUser(null); setShowLogin(true); localStorage.removeItem('qws-session'); };

  const startRec = async () => {
    try {
      const stream = await navigator.mediaDevices.getUserMedia({ audio: true });
      mediaRef.current = new MediaRecorder(stream);
      chunks.current = [];
      mediaRef.current.ondataavailable = e => chunks.current.push(e.data);
      mediaRef.current.onstop = () => { setAudioBlob(new Blob(chunks.current, { type: 'audio/webm' })); stream.getTracks().forEach(t => t.stop()); };
      mediaRef.current.start();
      setRecording(true);
    } catch (e) { alert('Microphone denied'); }
  };

  const stopRec = () => { if (mediaRef.current && recording) { mediaRef.current.stop(); setRecording(false); } };

  const saveDetection = () => {
    if (!audioBlob || !selSpecies || !location) return;
    setDetections(p => [...p, { id: Date.now(), species: selSpecies, lat: location.lat, lng: location.lng, by: user.name, at: new Date().toISOString() }]);
    setAudioBlob(null); setSelSpecies(null); setPanel(null);
  };

  const addStation = () => {
    if (!location) return alert('Need GPS');
    setStations(p => [...p, { id: Date.now(), name: 'Station ' + (stations.length + 1), lat: location.lat, lng: location.lng, by: user.name, at: new Date().toISOString() }]);
    setPanel(null);
  };

  const addBox = () => {
    if (!location || !boxForm.name) return alert('Need name and GPS');
    setBoxes(p => [...p, { id: Date.now(), ...boxForm, lat: location.lat, lng: location.lng, status: 'empty', by: user.name, at: new Date().toISOString() }]);
    setBoxForm({ name: '', type: 'bluebird' }); setPanel(null);
  };

  const deleteItem = (type, id) => {
    if (type === 'detection') setDetections(p => p.filter(x => x.id !== id));
    if (type === 'station') setStations(p => p.filter(x => x.id !== id));
    if (type === 'box') setBoxes(p => p.filter(x => x.id !== id));
    setSelected(null);
  };

  const toPixel = (lat, lng) => {
    const scale = Math.pow(2, zoom) * 256 / 360;
    const x = (lng - mapCenter.lng) * scale + 200;
    const yScale = Math.pow(2, zoom) * 256 / (2 * Math.PI);
    const y = (Math.log(Math.tan(Math.PI / 4 + mapCenter.lat * Math.PI / 360)) - Math.log(Math.tan(Math.PI / 4 + lat * Math.PI / 360))) * yScale + 300;
    return { x, y };
  };

  const filtered = BIRDS.filter(b => b.name.toLowerCase().includes(filter.toLowerCase()));

  const S = {
    loading: { display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', height: '100vh', background: BRAND.black },
    loginWrap: { display: 'flex', alignItems: 'center', justifyContent: 'center', minHeight: '100vh', background: BRAND.black, padding: 20 },
    loginCard: { background: BRAND.blackLight, borderRadius: 16, padding: 28, width: '100%', maxWidth: 340, border: '1px solid ' + BRAND.olive + '44' },
    input: { width: '100%', padding: 12, background: BRAND.black, border: '1px solid ' + BRAND.olive + '44', borderRadius: 8, color: BRAND.cream, fontSize: 14, marginBottom: 10, boxSizing: 'border-box' },
    btn: { width: '100%', padding: 12, background: BRAND.olive, border: 'none', borderRadius: 8, color: BRAND.cream, fontSize: 14, fontWeight: 600, cursor: 'pointer', marginBottom: 8 },
    link: { width: '100%', background: 'none', border: 'none', color: BRAND.olive, fontSize: 13, cursor: 'pointer' },
    smallBtn: { background: BRAND.olive + '55', border: 'none', borderRadius: 4, color: BRAND.cream, padding: '4px 10px', fontSize: 11, cursor: 'pointer' },
    app: { fontFamily: 'Georgia,serif', background: BRAND.black, height: '100vh', display: 'flex', flexDirection: 'column', overflow: 'hidden' },
    header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '8px 12px', background: BRAND.blackLight, borderBottom: '1px solid ' + BRAND.olive + '33' },
    mapWrap: { flex: 1, position: 'relative', overflow: 'hidden' },
    zoomCtrl: { position: 'absolute', right: 10, top: 10, display: 'flex', flexDirection: 'column', gap: 4, zIndex: 10 },
    zoomBtn: { width: 32, height: 32, background: BRAND.blackLight + 'ee', border: '1px solid ' + BRAND.olive + '44', borderRadius: 6, color: BRAND.cream, fontSize: 16, cursor: 'pointer' },
    stats: { position: 'absolute', left: 10, top: 10, display: 'flex', gap: 6, zIndex: 10 },
    badge: { background: BRAND.blackLight + 'ee', border: '1px solid ' + BRAND.olive + '44', borderRadius: 16, padding: '4px 10px', fontSize: 11, color: BRAND.cream },
    coords: { position: 'absolute', left: 10, bottom: 70, background: BRAND.blackLight + 'ee', borderRadius: 4, padding: '4px 8px', fontSize: 10, color: BRAND.creamMuted, zIndex: 10 },
    popup: { position: 'absolute', left: '50%', top: '35%', transform: 'translate(-50%,-50%)', background: BRAND.blackLight, border: '1px solid ' + BRAND.olive + '66', borderRadius: 10, padding: 14, minWidth: 200, zIndex: 200 },
    panel: { position: 'absolute', left: 10, right: 10, bottom: 70, background: BRAND.blackLight + 'fa', border: '1px solid ' + BRAND.olive + '66', borderRadius: 10, padding: 14, zIndex: 150 },
    panelHead: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: 10, fontSize: 14, fontWeight: 600, color: BRAND.olive },
    closeBtn: { background: 'none', border: 'none', color: BRAND.creamMuted, fontSize: 16, cursor: 'pointer' },
    chip: { padding: 8, border: '1px solid ' + BRAND.olive + '33', borderRadius: 6, fontSize: 11, color: BRAND.cream, cursor: 'pointer', textAlign: 'left' },
    nav: { display: 'flex', background: BRAND.blackLight, borderTop: '1px solid ' + BRAND.olive + '33' },
    navBtn: { flex: 1, display: 'flex', flexDirection: 'column', alignItems: 'center', padding: '8px 4px', background: 'none', border: 'none', color: BRAND.cream, cursor: 'pointer' },
  };

  if (loading) return <div style={S.loading}><img src={QWS_LOGO} style={{ width: 100, height: 100 }} alt="" /><p style={{ color: BRAND.creamMuted, marginTop: 16 }}>Loading...</p></div>;

  if (showLogin) return (
    <div style={S.loginWrap}>
      <div style={S.loginCard}>
        <img src={QWS_LOGO} style={{ width: 120, height: 120, margin: '0 auto 16px', display: 'block' }} alt="" />
        <h1 style={{ margin: 0, fontSize: 20, color: BRAND.olive, textAlign: 'center' }}>Quinn Wildlife Sanctuary</h1>
        <p style={{ margin: '8px 0 20px', fontSize: 12, color: BRAND.creamMuted, textAlign: 'center' }}>Conservation Mapping</p>
        {!regMode ? (
          <>
            <input style={S.input} placeholder="Email" value={loginForm.email} onChange={e => setLoginForm(p => ({ ...p, email: e.target.value }))} />
            <input style={S.input} type="password" placeholder="Password" value={loginForm.password} onChange={e => setLoginForm(p => ({ ...p, password: e.target.value }))} onKeyPress={e => e.key === 'Enter' && login()} />
            <button style={S.btn} onClick={login}>Sign In</button>
            <button style={S.link} onClick={() => setRegMode(true)}>Create account</button>
          </>
        ) : (
          <>
            <input style={S.input} placeholder="Name" value={regForm.name} onChange={e => setRegForm(p => ({ ...p, name: e.target.value }))} />
            <input style={S.input} placeholder="Email" value={regForm.email} onChange={e => setRegForm(p => ({ ...p, email: e.target.value }))} />
            <input style={S.input} type="password" placeholder="Password" value={regForm.password} onChange={e => setRegForm(p => ({ ...p, password: e.target.value }))} />
            <button style={S.btn} onClick={register}>Register</button>
            <button style={S.link} onClick={() => setRegMode(false)}>Back to login</button>
          </>
        )}
      </div>
    </div>
  );

  const tileX = Math.floor((mapCenter.lng + 180) / 360 * Math.pow(2, zoom));
  const tileY = Math.floor((1 - Math.log(Math.tan(mapCenter.lat * Math.PI / 180) + 1 / Math.cos(mapCenter.lat * Math.PI / 180)) / Math.PI) / 2 * Math.pow(2, zoom));

  return (
    <div style={S.app}>
      <header style={S.header}>
        <div style={{ display: 'flex', alignItems: 'center', gap: 8 }}>
          <img src={QWS_LOGO} style={{ width: 32, height: 32 }} alt="" />
          <span style={{ fontSize: 14, fontWeight: 600, color: BRAND.olive }}>Quinn Wildlife</span>
        </div>
        <button onClick={logout} style={S.smallBtn}>Logout</button>
      </header>

      <div style={S.mapWrap}>
        <div style={{ position: 'absolute', inset: 0, background: '#1a2a1a' }}>
          <img src={"https://tile.openstreetmap.org/" + zoom + "/" + tileX + "/" + tileY + ".png"} style={{ width: '100%', height: '100%', objectFit: 'cover', opacity: 0.85 }} alt="" />
        </div>

        <svg style={{ position: 'absolute', inset: 0 }}>
          {layers.detections && detections.map(d => { const p = toPixel(d.lat, d.lng); return <g key={d.id} transform={"translate(" + p.x + "," + p.y + ")"} onClick={() => setSelected({ type: 'detection', data: d })} style={{ cursor: 'pointer' }}><circle r="10" fill={BRAND.olive} stroke="#fff" strokeWidth="2" /><text y="4" textAnchor="middle" fontSize="10"></text></g>; })}
          {layers.stations && stations.map(s => { const p = toPixel(s.lat, s.lng); return <g key={s.id} transform={"translate(" + p.x + "," + p.y + ")"} onClick={() => setSelected({ type: 'station', data: s })} style={{ cursor: 'pointer' }}><circle r="12" fill={BRAND.brown} stroke="#fff" strokeWidth="2" /><text y="4" textAnchor="middle" fontSize="12"></text></g>; })}
          {layers.boxes && boxes.map(b => { const p = toPixel(b.lat, b.lng); return <g key={b.id} transform={"translate(" + p.x + "," + p.y + ")"} onClick={() => setSelected({ type: 'box', data: b })} style={{ cursor: 'pointer' }}><rect x="-10" y="-10" width="20" height="20" rx="3" fill={BRAND.olive} stroke="#fff" strokeWidth="2" /><text y="4" textAnchor="middle" fontSize="10"></text></g>; })}
          {location && (() => { const p = toPixel(location.lat, location.lng); return <g transform={"translate(" + p.x + "," + p.y + ")"}><circle r="16" fill={BRAND.olive + '44'} /><circle r="6" fill="#4a90d9" stroke="#fff" strokeWidth="2" /></g>; })()}
        </svg>

        <div style={S.zoomCtrl}>
          <button style={S.zoomBtn} onClick={() => setZoom(z => Math.min(18, z + 1))}>+</button>
          <button style={S.zoomBtn} onClick={() => setZoom(z => Math.max(10, z - 1))}>-</button>
          <button style={S.zoomBtn} onClick={() => location && setMapCenter({ ...location })}></button>
        </div>

        <div style={S.stats}>
          <span style={S.badge}> {detections.length}</span>
          <span style={S.badge}> {stations.length}</span>
          <span style={S.badge}> {boxes.length}</span>
        </div>

        {location && <div style={S.coords}> {location.lat.toFixed(5)}, {location.lng.toFixed(5)}</div>}
      </div>

      {selected && (
        <div style={S.popup}>
          <div style={{ display: 'flex', alignItems: 'center', gap: 8, marginBottom: 8 }}>
            <span>{selected.type === 'detection' ? '' : selected.type === 'station' ? '' : ''}</span>
            <span style={{ fontWeight: 600, color: BRAND.cream }}>{selected.type === 'detection' ? (BIRDS.find(b => b.code === selected.data.species)?.name || selected.data.species) : selected.data.name}</span>
            <button onClick={() => setSelected(null)} style={{ marginLeft: 'auto', background: 'none', border: 'none', color: BRAND.creamMuted, cursor: 'pointer' }}></button>
          </div>
          <div style={{ fontSize: 11, color: BRAND.creamMuted }}>{selected.data.by}  {new Date(selected.data.at).toLocaleDateString()}</div>
          {user?.role === 'admin' && <button onClick={() => deleteItem(selected.type, selected.data.id)} style={{ ...S.smallBtn, marginTop: 10, background: '#944' }}>Delete</button>}
        </div>
      )}

      {panel === 'record' && (
        <div style={S.panel}>
          <div style={S.panelHead}><span> Record</span><button onClick={() => { setPanel(null); setAudioBlob(null); }} style={S.closeBtn}></button></div>
          {!recording && !audioBlob && <button onClick={startRec} style={{ ...S.btn, background: '#c44' }}> Start</button>}
          {recording && <button onClick={stopRec} style={{ ...S.btn, background: BRAND.brown }}> Stop</button>}
          {audioBlob && (
            <>
              <audio src={URL.createObjectURL(audioBlob)} controls style={{ width: '100%', marginBottom: 10 }} />
              <input style={S.input} placeholder="Search species" value={filter} onChange={e => setFilter(e.target.value)} />
              <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: 6, maxHeight: 120, overflow: 'auto', marginBottom: 10 }}>
                {filtered.slice(0, 8).map(b => <button key={b.code} onClick={() => setSelSpecies(b.code)} style={{ ...S.chip, background: selSpecies === b.code ? BRAND.olive + '66' : BRAND.blackLight }}>{b.name}</button>)}
              </div>
              <button onClick={saveDetection} disabled={!selSpecies} style={{ ...S.btn, opacity: selSpecies ? 1 : 0.5 }}>Save</button>
            </>
          )}
        </div>
      )}

      {panel === 'station' && (
        <div style={S.panel}>
          <div style={S.panelHead}><span> Add Station</span><button onClick={() => setPanel(null)} style={S.closeBtn}></button></div>
          {location ? <><div style={{ fontSize: 12, color: BRAND.creamMuted, marginBottom: 12 }}> {location.lat.toFixed(5)}, {location.lng.toFixed(5)}</div><button onClick={addStation} style={S.btn}>Add Here</button></> : <p style={{ color: '#c44' }}>Waiting for GPS...</p>}
        </div>
      )}

      {panel === 'box' && (
        <div style={S.panel}>
          <div style={S.panelHead}><span> Add Box</span><button onClick={() => setPanel(null)} style={S.closeBtn}></button></div>
          <input style={S.input} placeholder="Box name" value={boxForm.name} onChange={e => setBoxForm(p => ({ ...p, name: e.target.value }))} />
          <select style={S.input} value={boxForm.type} onChange={e => setBoxForm(p => ({ ...p, type: e.target.value }))}>
            <option value="bluebird">Bluebird</option>
            <option value="wren">Wren</option>
            <option value="owl">Owl</option>
          </select>
          <button onClick={addBox} disabled={!location || !boxForm.name} style={{ ...S.btn, opacity: location && boxForm.name ? 1 : 0.5 }}>Add Here</button>
        </div>
      )}

      {panel === 'layers' && (
        <div style={S.panel}>
          <div style={S.panelHead}><span> Layers</span><button onClick={() => setPanel(null)} style={S.closeBtn}></button></div>
          {[['detections', ' Detections'], ['stations', ' Stations'], ['boxes', ' Boxes']].map(([k, label]) => (
            <label key={k} style={{ display: 'flex', alignItems: 'center', gap: 10, padding: '8px 0', color: BRAND.cream }}>
              <input type="checkbox" checked={layers[k]} onChange={e => setLayers(p => ({ ...p, [k]: e.target.checked }))} />
              {label}
            </label>
          ))}
        </div>
      )}

      <nav style={S.nav}>
        {[['record', '', 'Record'], ['box', '', 'Box'], ['station', '', 'Station'], ['layers', '', 'Layers']].map(([k, icon, label]) => (
          <button key={k} onClick={() => setPanel(panel === k ? null : k)} style={{ ...S.navBtn, background: panel === k ? BRAND.olive : 'transparent' }}>
            <span style={{ fontSize: 20 }}>{icon}</span>
            <span style={{ fontSize: 10 }}>{label}</span>
          </button>
        ))}
      </nav>
    </div>
  );
}

export default App;
